question:
$P(x)$ is a polynomial of degree $3n$ such that
\begin{eqnarray*} P(0) = P(3) = \cdots &=& P(3n) = 2, \\ P(1) = P(4) = \cdots &=& P(3n-2) = 1, \\ P(2) = P(5) = \cdots &=& P(3n-1) = 0, \quad\text{ and }\\ && P(3n+1) = 730.\end{eqnarray*}
Determine $n$.

(Choose one) Let the sequence $\{a_n\}$ have a sum of the first $n$ terms denoted by $S_n$, with $a_1=1$, satisfying $\overrightarrow{a}=(S_{n+1}-2S_n,S_n)$, $\overrightarrow{b}=(2,n)$, and $\overrightarrow{a} \parallel \overrightarrow{b}$.  
(1) Prove that the sequence $\left\{ \frac{S_n}{n} \right\}$ is a geometric sequence;  
(2) Find the sum of the first $n$ terms of the sequence $\{S_n\}$, denoted by $T_n$.

A marksman has a probability of 0.8 to hit the target with one shot. If they shoot 4 times in a row, with each shot being independent of the previous, the following statements can be made:  
(1) The probability of hitting the target on the second try is 0.8;  
(2) The probability of hitting the target exactly three times is $0.8^3 \times 0.2$;  
(3) The probability of hitting the target at least once is $1 - 0.2^4$;  
Which of the above conclusions are correct? Write the number(s) of all correct conclusions.

Among the following statements, the number of correct ones is (    ).

$①$ If $f(x)= \frac{1}{2^{x}+1}+a$ is an odd function, then $a= \frac{1}{2}$;

$②$ The converse of the statement "In $\triangle ABC$, if $\cos A > \cos B$, then $A < B$" is a false proposition;

$③$ "Three numbers $a$, $b$, $c$ are in geometric progression" is neither a sufficient nor necessary condition for "$b= \sqrt{ab}$";

$④$ The negation of the statement "For all $x \in \mathbb{R}$, $x^{3}-x^{2}+1 \leqslant 0$" is "There exists an $x_{0} \in \mathbb{R}$, $x_{0}^{3}-x_{0}^{2}+1 > 0$".

A: 0

B: 1

C: 2

D: 3

An urn contains marbles of five colors: red, white, blue, green, and yellow. When five marbles are drawn without replacement, the following events are equally likely: 
(a) the selection of five red marbles; 
(b) the selection of one white and four red marbles; 
(c) the selection of one white, one blue, and three red marbles; 
(d) the selection of one white, one blue, one green, and two red marbles; 
(e) the selection of one marble of each color except yellow. 
What is the smallest number of marbles satisfying the given condition, if it is known there are exactly 4 yellow marbles?
(A) 22
(B) 25
(C) 27
(D) 29
(E) 31

Calculate (1) $-202 \cdot 3^{0}+{(-\frac{1}{2})}^{-2} \times |-1+3|+\sqrt{12}$.  
(2) Below is Xiaoying's process of simplifying fractions. Please read carefully and complete the corresponding tasks:  
$(\frac{x-1}{x+1}-\frac{{x}^{2}-1}{{x}^{2}-2x+1})÷\frac{x}{x-1}$:  
$=[\frac{x-1}{x+1}-\frac{(x-1)(x+1)}{{(x-1)}^{2}}]÷\frac{x}{x-1}\ldots \ldots \ldots \ldots $ Step one;  
$=(\frac{x-1}{x+1}-\frac{x+1}{x-1})÷\frac{x}{x-1}\ldots \ldots \ldots \ldots $ Step two;  
$=\frac{{(x-1)}^{2}-{(x+1)}^{2}}{(x+1)(x-1)}÷\frac{x}{x-1}\ldots \ldots \ldots \ldots $ Step three;  
$=\frac{{x}^{2}-2x+1-{x}^{2}+2x+1}{(x+1)(x-1)}⋅\frac{x-1}{x}\ldots \ldots \ldots \ldots $ Step four;  
$=\frac{2}{x(x+1)}\ldots \ldots \ldots \ldots $ Step five;  
$=\frac{2}{{x}^{2}+x}\ldots \ldots \ldots \ldots $ Step six;  
Task one: Fill in the blanks:  
1. In the first step of the simplification process, transforming the term $\frac{{x}^{2}-1}{{x}^{2}-2x+1}$ into $\frac{(x-1)(x+1)}{{(x-1)}^{2}}$ belongs to ______;  
$A$. Polynomial multiplication  
$B$. Factorization  
2. In the simplification process, step ______ is to find a common denominator for the fractions, based on ______;  
3. Error starts to appear in step ______, the specific reason for the error is ______.  
Task two: Please write down the correct result after simplifying the fraction.

Calculate the area of the figure bounded by the lines given by the equations:

$$
\begin{aligned}
& \left\{\begin{array}{l}
x=3(t-\sin t) \\
y=3(1-\cos t)
\end{array}\right. \\
& y=3(0<x<6 \pi, y \geq 3)
\end{aligned}
$$

Definition: If the function $y=f(x)$ has a point $x_{0}(a < x_{0} < b)$ in the given interval $[a,b]$ within its domain, satisfying $f(x_{0})= \dfrac {f(b)-f(a)}{b-a}$, then the function $y=f(x)$ is called an "average value function" on $[a,b]$, and $x_{0}$ is its mean value point.  
For example, $y=|x|$ is an "average value function" on $[-2,2]$, and $0$ is its mean value point. Given the following propositions:  
$(1)$ The function $f(x)=\sin x-1$ is an "average value function" on $[-\pi,\pi]$;  
$(2)$ If $y=f(x)$ is an "average value function" on $[a,b]$, then its mean value point $x_{0}\leqslant \dfrac {a+b}{2}$;  
$(3)$ If the function $f(x)=x^{2}+mx-1$ is an "average value function" on $[-1,1]$, then the real number $m\in(-2,0)$;  
$(4)$ If $f(x)=\ln x$ is an "average value function" on the interval $[a,b](b > a\geqslant 1)$, and $x_{0}$ is one of its mean value points, then $\ln x_{0} < \dfrac {1}{ \sqrt {ab}}$.  
Among these propositions, the true ones are __________ (Write down the numbers of all true propositions).

Find all pairs of positive numbers \((x, y)\) that satisfy the system of equations:
\[
\left\{
\begin{array}{l}
2 x - \sqrt{x y} - 4 \sqrt{\frac{x}{y}} + 2 = 0 \\
2 x^{2} + x^{2} y^{4} = 18 y^{2}.
\end{array}
\right.
\]

Find the area of triangle $DEF$ below.

[asy]
unitsize(1inch);
pair D, E, F;
D = (0,0);
E = (2*sqrt(3),0);
F = (0,2);
draw (D--E--F--D, linewidth(0.9));
draw(rightanglemark(E,D,F,3));
label("$D$", D, S);
label("$E$", E, S);
label("$F$", F, N);
label("$8$", F/2, W);
label("$30^\circ$", (1.5, 0), N);
[/asy]

Find the standard equation of the conic section that satisfies the following conditions:

\\((1)\\) The ellipse passes through \\(A(2, -\frac{\sqrt{2}}{2})\\) and \\(B(-\sqrt{2}, -\frac{\sqrt{3}}{2})\\);

\\((2)\\) It shares a common asymptote with the hyperbola \\(C_1: \frac{x^2}{5} - \frac{y^2}{3} = 1\\), and is a hyperbola with a focal length of \\(8\\) denoted as \\(C_2\\).

For the function $y=f(x)$ ($x \in \mathbb{R}$), the following statements are given:  
$(1)$ In the same Cartesian coordinate system, the graphs of $y=f(-1-x)$ and $y=f(x-1)$ are symmetric about the line $x=0$;  
$(2)$ If $f(1-x)=f(x-1)$, then the graph of $y=f(x)$ is symmetric about the line $x=1$;  
$(3)$ If $f(1+x)=f(x-1)$, then the function $y=f(x)$ is a periodic function;  
$(4)$ If $f(1-x)=-f(x-1)$, then the graph of $y=f(x)$ is symmetric about the point $(0,0)$.  
Among these, the correct statement numbers are $\boxed{1, 3, 4}$.

Given $\triangle ABC$ with vertex $A(5,1)$, the equation of the line containing the median $CM$ on side $AB$ is $2x-y-5=0$, and the equation of the line containing the altitude $BH$ on side $AC$ is $x-2y-5=0$. Find  
(Ⅰ) The equation of the line containing $AC$;  
(Ⅱ) The coordinates of point $B$.

Given $m=(\sqrt{3}\sin \omega x,\cos \omega x)$, $n=(\cos \omega x,-\cos \omega x)$ ($\omega > 0$, $x\in\mathbb{R}$), $f(x)=m\cdot n-\frac{1}{2}$ and the distance between two adjacent axes of symmetry on the graph of $f(x)$ is $\frac{\pi}{2}$.

$(1)$ Find the intervals of monotonic increase for the function $f(x)$;

$(2)$ If in $\triangle ABC$, the sides opposite to angles $A$, $B$, $C$ are $a$, $b$, $c$ respectively, and $b=\sqrt{7}$, $f(B)=0$, $\sin A=3\sin C$, find the values of $a$, $c$ and the area of $\triangle ABC$.

Given a function $f(x) = ax^3 + bx^2$, its graph passes through point $M(1, 4)$, and it has an extremum at $x = -2$.
(1) Find the values of the real numbers $a$ and $b$;
(2) If the function $f(x)$ is monotonically increasing on the interval $(m, m+1)$, find the range of values for $m$.

Given a line $l$ passing through the focus $F(1,0)$ of the parabola $y^2=2px$ ($p>0$) intersecting the parabola at points $M$ and $N$,
(Ⅰ) Write the standard equation of the parabola and the equation of its directrix;
(Ⅱ) $O$ is the origin of coordinates, and the lines $MO$ and $NO$ intersect the directrix at points $P$ and $Q$, respectively, find the minimum value of $|PQ|$.

Given a sequence $\{a\_n\}$ with the sum of its first $n$ terms denoted as $S\_n$, where $a\_1=2$, and $a\_{n+1}=S\_n+2 (n∈ℕ^*)$,

1. Find the general term formula for the sequence $\{a\_n\}$;
2. If a sequence $\{c\_n\}$ satisfies $c\_n= \frac {a_{n}}{(a_{n}-1)^{2}}$ and the sum of its first $n$ terms is denoted as $K\_n$, prove that $K\_n < 3$.

Given a sequence $\{a_n\}$ with the sum of its first $n$ terms denoted as $S_n$, if $S_n=n^2+5n$.
$(1)$ Prove that the sequence $\{a_n\}$ is an arithmetic sequence;
$(2)$ Find the sum of the first $n$ terms, $T_n$, of the sequence $\left\{ \frac{1}{a_n \cdot a_{n+1}} \right\}$.

Given a triangle $\Delta \text{A} \text{B} \text{C}$ with internal angles $\text{A}$, $\text{B}$, and $\text{C}$ opposite to sides $a$, $b$, and $c$, respectively. If vectors $\vec{m}=( a,\sqrt{3}b )$ and $\vec{n}=( \cos \text{A} ,\sin \text{B} )$ are collinear.

(I) Find $\text{A}$;
(II) If $a=\sqrt{7}$, $b=2$, find the area of $\Delta \text{A} \text{B} \text{C}$.

Given ellipse $C_{1}$ and parabola $C_{2}$ have a common focus $F(1,0)$, the center of $C_{1}$ and the vertex of $C_{2}$ are both at the origin. A line $l$ passing through point $M(4,0)$ intersects the parabola $C_{2}$ at points $A$ and $B$ (where point $A$ is in the fourth quadrant).
$(1)$ If $|MB|=4|AM|$, find the equation of line $l$;
$(2)$ If the symmetric point $P$ of the origin $O$ with respect to line $l$ is on the parabola $C_{2}$, and line $l$ has common points with ellipse $C_{1}$, find the minimum length of the major axis of ellipse $C_{1}$.

Given point $F(0,1)$, line $l$: $y=-1$, and $P$ as a moving point on the plane. Draw a line perpendicular to line $l$ passing through point $P$, with its foot $Q$. It is known that $\overrightarrow{QP} \cdot \overrightarrow{QF}=\overrightarrow{FP} \cdot \overrightarrow{FQ}$.

(1) Find the equation of the trajectory $C$ of the moving point $P$;

(2) Given that circle $M$ passes through the fixed point $D(0,2)$, and the center $M$ moves on the trajectory $C$. Circle $M$ intersects with the $x$-axis at points $A$ and $B$. Let $|DA|=l_{1}$ and $|DB|=l_{2}$. Find the maximum value of $\frac{l_{1}}{l_{2}}+\frac{l_{2}}{l_{1}}$.

Given set A={-1, 0, 1, 2}, B={x | -1 < x < 2}, find A∩B (the intersection of sets A and B).

A: {-1, 0, 1, 2}
B: {-1, 0, 1}
C: {0, 1, 2}
D: {0, 1}

Given that $S_n$ is the sum of the first $n$ terms of the sequence $\{a_n\}$ and it holds that $S_n - 2a_n = n - 4$,  
$(I)$ Prove that $\{S_n - n + 2\}$ is a geometric sequence;  
$(II)$ Let the sum of the first $n$ terms of the sequence $\{S_n\}$ be $T_n$, find $T_n$.

Given that $\sin \alpha$ and $\cos \alpha$ are the two roots of the equation $2x^2 - (\sqrt{3} + 1)x + \frac{m}{3} = 0$ with respect to $x$.

(1) Find the value of the real number $m$;

(2) Find the roots of the equation and their corresponding values of $\alpha$.

Given that $\{a_n\}$ is a geometric sequence with $a_1=3$ and $a_4=24$, and the sequence $\{b_n\}$ satisfies: $b_1=0$, $b_n+b_{n+1}=a_n$,  
(1) Prove that $a_n=3\times2^{n-1}$;  
(2) Prove that $b_n=2^{n-1}+(-1)^n$.

Given that $a > 0$ and $b > 0$, the function $f(x) = |x-a| + |x+b|$ has a minimum value of $2$.  
$(1)$ Find the value of $a+b$;  
$(2)$ Prove that it is not possible for both $a^{2}+a > 2$ and $b^{2}+b > 2$ to hold at the same time.

Given that $a$ and $b$ are positive real numbers, and for any $x \in (0, +\infty)$, the inequality $(a+b)x-1 \leq x^2$ always holds.  
(1) Find the minimum value of $\frac{1}{a} + \frac{1}{b}$;  
(2) Determine the position of point $P(1, -1)$ relative to the ellipse $\frac{x^2}{a^2} + \frac{y^2}{b^2} = 1$ and explain the reason.

Given that $a$, $b$, $c$ are vectors in a plane, the number of true statements among the following is (　　)

① $(a \cdot b) \cdot c = a \cdot (b \cdot c)$;

② $|a \cdot b| = |a| \cdot |b|$;

③ $|a + b|^2 = (a + b)^2$;

④ $a \cdot b = b \cdot c \Rightarrow a = c$

A: 1
B: 2
C: 3
D: 4

Given that the function $f(x)=\sin (π-ωx)\cos ωx+\cos ^{2}ωx\ (ω > 0)$ has a minimum positive period of $π$.
(I) Find the value of $ω$;
(II) The horizontal coordinates of each point on the graph of the function $y=f(x)$ are shortened to half of the original, and the vertical coordinates remain unchanged, resulting in the graph of the function $y=g(x)$. Find the minimum value of the function $y=g(x)$ on the interval $[0, \frac{π}{16}]$.

Given that the power function $f(x)=({{m^2}-2m+2}){x^{5k-2{k^2}}}({k∈Z})$ is an even function and monotonically increasing on $\left(0,+\infty \right)$.
$(1)$ Find the analytical expression of the function $f\left(x\right)$;
$(2)$ If $f\left(2x-1\right) \lt f\left(2-x\right)$, find the range of values for $x$;
$(3)$ If positive real numbers $a$ and $b$ satisfy $a+b=4m$, find the minimum value of $\frac{1}{{a+1}}+\frac{4}{{b+1}}$.

Given that the sequence $\{a_{n}\}$ is a geometric sequence, $a_{2}+a_{5}=14$, $a_{2}\cdot a_{5}=-32$, and $a_{1} \gt 0$.  
$(1)$ Find the general term formula of the sequence $\{a_{n}\}$;  
$(2)$ Let ${b}_{n}=\frac{1}{\log_{2}|{a}_{n+1}|\cdot \log_{2}|{a}_{n+3}|}$. If the sum of the first $n$ terms of $\{b_{n}\}$ is $S_{n}$, prove that ${S}_{n}＜\frac{3}{4}$.

Given that the sum of the first $n$ terms of an increasing arithmetic sequence ${a_n}$ is $S_n$, $a_4a_6=117$, and $a_3+a_7=22$.

1. Find $S_n$;
2. Find the sum of the first $n$ terms of the sequence $\{\frac{1}{S_n+3n+6}\}$, denoted as $T_n$.

Given that the sum of the first $n$ terms of the sequence $\{a\_n\}$ is $S\_n$, and it satisfies $S\_n = n^2 + n$, where $n \in \mathbb{N}^*$.

(1) Find the general term formula for $\{a\_n\}$;

(2) Find the sum of the first $n$ terms of the sequence $\{\frac{1}{(n+1)a\_n}\}$.

Given the complex conjugate of a complex number $z$ is $\bar{z}$, and it is known that $(1+2i)\bar{z} = 4+3i$,  
(1) find the complex number $z$ and the value of $\frac{z}{\bar{z}}$;  
(2) find the equation of the trajectory of points corresponding to the complex number $z_1$ that satisfies $|z_1 - 1| = |z|$.

Given the ellipse $C:\dfrac{x^2}{8}+\dfrac{y^2}{4}=1$ with its left focus at $F_1$, and the line $l:y=x-2$ intersects the ellipse $C$ at points $A$ and $B$.

    (1) Find the length of segment $AB$;

    (2) Find the area of $\Delta ABF_1$.

Given the equation of circle C is $x^2+y^2=4$, and point P is any moving point on circle C. A perpendicular line to the x-axis is drawn from point P, and its foot is H. It is given that $\overrightarrow{OQ} = \frac{1}{2}(\overrightarrow{OP} + \overrightarrow{OH})$, where Q is a moving point. The trajectory of Q is E. The trajectory E intersects the positive x-axis and the positive y-axis at points A and B, respectively. The line $y=kx$ ($k>0$) intersects line AB at point D and intersects trajectory E at points M and N.  
(Ⅰ) Find the equation of trajectory E;  
(Ⅱ) Find the maximum value of the area of quadrilateral AMBN.

Given the following judgments:  
① $2\pi a^2b$ and $\frac{1}{3}a^2b$ are like terms;  
② In the polynomial $5a + 4b - 1$, the constant term is 1;  
③ $x - 2xy + y$ is a quadratic trinomial;  
④ $\frac{x+y}{4}$, $\frac{x}{2} + 1$, $\frac{a}{4}$ are all polynomials. Among these judgments, the correct ones are (　　)  
A: ①②③  
B: ①③  
C: ①③④  
D: ①②③④

Given the following propositions:

(1) Let set $M={x|0 < x\leqslant 3}$, $N={x|0 < x\leqslant 2}$, then "$a\in M$" is a sufficient but not necessary condition for "$a\in N$";

(2) The converse of the proposition "If $a\in M$, then $b\notin M$" is: "If $b\in M$, then $a\notin M$";

(3) If proposition $p\land q$ is false, then $p$ and $q$ are both false propositions;

(4) The negation of proposition $P$: "$\exists {{x}\_{0}}\in R,x\_{0}^{2}-{{x}\_{0}}-1 > 0$" is "$\forall x\in R,{{x}^{2}}-x-1\leqslant 0$"

The number of true propositions among the above is ( ).
A: (1)
B: (2)
C: (3)
D: (4)

Given the function $f(x) = (x^2 - ax - a)e^x$.

(1) When $a=1$, find the intervals of monotonicity for $f(x)$;

(2) If $a \in (0, 2)$, for any $x_1, x_2 \in [-4, 0]$, it always holds that $|f(x_1) - f(x_2)| < (6e^{-2} + 2) \cdot m$, find the range of $m$.

Given the function $f(x) = x^2 - 2x + 2$, where $x \in A$, find the maximum and minimum values of $f(x)$ when $A$ is the following intervals.

$(1) A = [-2, 0]$;

$(2) A = [2, 3]$

Given the function $f(x)=\cos x\cdot \sin (x+ \frac {π}{3})- \sqrt {3}\cos ^{2}x+ \frac{ \sqrt {3}}{4}$, $x\in R$.
(1) Find the smallest positive period and the equation of the axis of symmetry of $f(x)$;
(2) Find the range of $x$ for which $f(x)\geqslant \frac {1}{4}$.

Given the function $f(x)=\ln x+ \frac{1-x}{ax}$, where $a$ is a positive constant.
(1) Find the range of values for $a$ such that the function $f(x)$ is monotonically increasing in the interval $[1,+\infty)$;
(2) Find the minimum value of the function $f(x)$ in the interval $[1,2]$.

Given the function $f(x)=\sin (x+ \frac {π}{2}) \cos (x- \frac {π}{3})$.
(1) Find the smallest positive period of the function $f(x)$;
(2) Translate the graph of the function $y=f(x)$ downward by $\frac{1}{4}$ unit, then stretch the vertical coordinates of each point on the graph by a factor of 4 (the horizontal coordinates remain unchanged) to obtain the graph of the function $y=g(x)$. Find the maximum value of the function $y=g(x)$ on $[0, \frac {π}{3}]$.

Given the function $f(x)=\sin x-x\cos x$, the following conclusions are drawn:  
(1) When $x\in[0,\pi]$, $f(x)\geqslant 0$;  
(2) When $0 < \alpha < \beta < \pi$, $\alpha\cdot\sin \beta > \beta\cdot\sin \alpha$;  
(3) If $n < \frac {\sin x}{x} < m$ holds for $\forall x\in(0, \frac {\pi}{2})$, then the minimum value of $m-n$ is $1- \frac {2}{\pi }$;  
(4) Given $k\in[0,1]$, when $x_{i}\in(0,2\pi)$, the number of $x_{i}$ that satisfy $\frac {|\sin x_{i}|}{x_{i}}=k$ is denoted as $n$, then the set of all possible values of $n$ is $\{0,1,2,3\}$. The correct number of conclusions is $(\quad)$  
A: $1$  
B: $2$  
C: $3$  
D: $4$

Given the function $f(x)=e^{x}-a\ln x-a$.  
(I) When $a=e$, find the equation of the tangent line to the curve $y=f(x)$ at the point $(1,f(1))$;  
(II) Prove that for $\forall a\in(0,e)$, $f(x)$ has a minimum value in the interval $\left( \frac {a}{e},1\right)$, and the minimum value is greater than $0$.

Given the hyperbola equation $$\frac {x^{2}}{a^{2}}- \frac {y^{2}}{b^{2}}=1(a>0,b>0)$$, an ellipse C has its vertices at the foci of this hyperbola, and its foci at the vertices of the hyperbola.  
(1) When $$a= \sqrt {3}$$ and $b=1$, find the equation of ellipse C;  
(2) Under the condition of (1), the line $l: y=kx+ \frac {1}{2}$ intersects the y-axis at point P and intersects the ellipse at points A and B. If O is the origin, and the area ratio of $\triangle AOP$ to $\triangle BOP$ is 2:1, find the equation of line $l$;  
(3) If $a=1$, the ellipse C and the line $l': y=x+5$ have common points, find the minimum length of the major axis of this ellipse.

Given the inequality $|2x + 1| - |x - 1| \leqslant \log_2 a$ (where $a > 0$).
(1) Find the solution set when $a = 4$;
(2) Find the range of real number $a$ if the inequality has a solution.

Given the plane vectors $\overrightarrow{a}$, $\overrightarrow{b}$, $\overrightarrow{c}$, where $\overrightarrow{a}=(1,2)$

(Ⅰ) If $|\overrightarrow{c}|=3\sqrt{5}$ and $\overrightarrow{a} \parallel \overrightarrow{c}$, find the coordinates of $\overrightarrow{c}$;

(Ⅱ) If $|\overrightarrow{b}|=3\sqrt{5}$, and $(4\overrightarrow{a}-\overrightarrow{b}) \perp (2\overrightarrow{a}+\overrightarrow{b})$, find the cosine of the angle $\theta$ between $\overrightarrow{a}$ and $\overrightarrow{b}$.

Given the set $A=\{x| \frac {(x+1)^{2}(2-x)}{4+x}\geq0\}$, and the set $B=\{x| (x-a)(x-2a+1)\leq0\}$  
(1) Find the set $A$;  
(2) If $A\cup B=A$, find the range of the real number $a$.

Given the sets $A=\left\{ x\mid (x+4)(x-2) > 0 \right\}$, $B=\left\{ y\mid y=x^{2}-2x+2, x\in \mathbb{R} \right\}$, $C=\left\{ x\mid -4 \leqslant x \leqslant a \right\}$.  
(Ⅰ) Find $A\bigcap B$;  

(Ⅱ) If ${C}_{R}A \subseteq C$, find the range of the real number $a$.

Given two vectors in the plane, $\overrightarrow {a}=(\cos\alpha，(\lambda-1)\sin\alpha)$ and $\overrightarrow {b}=(\cos\beta，\sin\beta)$, where $\lambda>0$ and $0<\alpha<\beta<\frac{\pi}{2}$, if the vector $\overrightarrow {a}+ \overrightarrow {b}$ is perpendicular to $\overrightarrow {a}- \overrightarrow {b}$,  
(1) find the value of the real number $\lambda$;  
(2) if $\overrightarrow {a}\cdot \overrightarrow {b}= \frac{4}{5}$ and $\tan\alpha= \frac{4}{3}$, find the value of $\alpha$ (express the result in terms of inverse trigonometric functions).

Given vectors $\overrightarrow{a}=(1,2)$, $\overrightarrow{b}=(-1,3)$, and $\overrightarrow{c}=\lambda \overrightarrow{a}+ \overrightarrow{b}$
(1) Find the angle $\theta$ between vectors $\overrightarrow{a}$ and $\overrightarrow{b}$;
(2) Find the minimum value of $|\overrightarrow{c}|$.

If $f(x)$ is an increasing function defined on $(0,+\infty)$, and for all $x$, $y > 0$, it satisfies $f\left( \dfrac {x}{y}\right)=f(x)-f(y)$.  
$(1)$ Find the value of $f(1)$;  
$(2)$ If $f(6)=1$, solve the inequality $f(x+3)-f\left( \dfrac {1}{3}\right) < 2$.

In a "sing, read, speak, and spread" performance activity participated by six units, including units A and B, each unit's program is arranged together. If a lottery method is used to randomly determine the order of performance for each unit (numbered 1, 2, …, 6), calculate:  
(Ⅰ) The probability that both units A and B have even numbers as their performance order;  
(Ⅱ) The probability that the performance order numbers of units A and B are not adjacent.

In algebraic expression evaluation problems, the overall concept is widely used, such as: given the algebraic expression $5a+3b=-4$, find the value of the algebraic expression $2\left(a+b\right)+4\left(2a+b\right)+3$. The solution is as follows: The original expression $=2a+2b+8a+4b+3=10a+6b+3=2\left(5a+3b\right)+3=2\times \left(-4\right)+3=-5$. Using the overall concept, complete the following problems:  
$(1)$ Given $-m^{2}=m$, then $m^{2}+m+1=$______;  
$(2)$ Given $m-n=2$, find the value of $2\left(n-m\right)-4m+4n-3$;  
