In general, the locus of a moving point $F$ in a plane, where the ratio of its distances to two fixed points $P$ and $Q$ is a constant $\lambda (\lambda\ \ \gt 0$ and $\lambda \neq 1)$, is a circle. This circle is famously known in the history of mathematics as the "Apollonian Circle." Based on the above fact, complete the following questions:  
$(1)$ Given points $A_{1}(1,0)$ and $A_{2}(-2,0)$, if $\frac{|MA_{1}|}{|MA_{2}|}=\frac{\sqrt{2}}{2}$, find the equation of the locus of the moving point $M$;  
$(2)$ Given that point $N$ moves on the circle $(x-3)^{2}+y^{2}=4$, and point $A_{3}(-1,0)$, investigate: Is there a fixed point $A_{4}$ such that $\frac{|NA_{3}|}{|NA_{4}|}=2$? If it exists, find the coordinates of the fixed point $A_{4}$; if it does not exist, please explain the reason.

In the Cartesian coordinate system $(xOy)$, the parametric equations of line $l$ are given by $\begin{cases} x=2-\sqrt{3}t \\ y=t \end{cases}$ $(t\text{ is a parameter})$, and the equation of circle $C$ is $x^2+y^2=4$. Establish a polar coordinate system with the coordinate origin $O$ as the pole and the non-negative semi-axis of the $x$-axis as the polar axis.

(I) Determine the polar equations of line $l$ and circle $C$;

(II) Determine the polar coordinates of the intersection points of line $l$ and circle $C$ (require $\theta \in [0,2\pi)$).

In the diagram, $ABCD$ and $EFGD$ are squares each of area 25. If $H$ is the midpoint of both $BC$ and $EF$, and $I$ is the midpoint of $CD$ and $FG$, find the total area of polygon $ABIHGD$.

[asy]
unitsize(3 cm);

pair A, B, C, D, E, F, G, H, I;

F = (0,0);
G = (1,0);
D = (1,1);
E = (0,1);
H = (E + F)/2;
I = (D + G)/2;
A = reflect(D,H)*(G);
B = reflect(D,H)*(F);
C = reflect(D,I)*(E);

draw(A--B--I--H--G--D--cycle);
draw(D--E--F--G--cycle);

label("$A$", A, N);
label("$B$", B, W);
label("$C$", C, S);
label("$D$", D, NE);
label("$E$", E, NW);
label("$F$", F, SW);
label("$G$", G, SE);
label("$H$", H, SW);
label("$I$", I, NE);
[/asy]

In the diagram, two pairs of identical isosceles triangles are cut off of square $ABCD$, leaving rectangle $PQRS$. The total area cut off is $200 \text{ m}^2$. What is the length of $PR$, in meters? [asy]
size(5cm);

pair a = (0, 1); pair b = (1, 1); pair c = (1, 0); pair d = (0, 0);
pair s = (0, 0.333); pair p = (0.667, 1); pair q = (1, 0.667); pair r = (0.333, 0);

// Thicken pen
defaultpen(linewidth(1));

// Fill triangles
path tri1 = a--p--s--cycle;
path tri2 = p--q--b--cycle;
path tri3 = q--c--r--cycle;
path tri4 = s--r--d--cycle;
fill(tri1, gray(0.75));fill(tri2, gray(0.75));
fill(tri3, gray(0.75));fill(tri4, gray(0.75));

// Draw rectangles
draw(a--b--c--d--cycle); draw(p--q--r--s--cycle);

// Labels
label("$A$", a, NW); label("$B$", b, NE); label("$C$", c, SE); label("$D$", d, SW);
label("$P$", p, N); label("$Q$", q, E); label("$R$", r, S); label("$S$", s, W);

[/asy]

